function decode85(src) {
  let dst = new Uint8Array(src.length), ndst = 0, v = 0, nb = 0;

  for (let i=0; i < src.length; i++) {
          let b = src.charCodeAt(i);
          if (b == 126) { // 126 => ~
              b = 34     // 24 => "
          } else if (b == 124) { // 124 => |
              b = 92             // 92 => \
          }

          if (b == 122 && nb == 0) { // 122 => z
                  nb = 5;
                  v = 0;
          } else {
                  v = v*85 + (b-33); // 33 => !
                  nb++;
          }
          if (nb == 5) {
                  dst[ndst++] = (v >> 24) & 255;
                  dst[ndst++] = (v >> 16) & 255;
                  dst[ndst++] = (v >> 8) & 255;
                  dst[ndst++] = (v) & 255;
                  nb = 0;
                  v = 0;
          }
  }

  if (nb > 1) {
          for (let i = nb; i < 5; i++) {
                  v = v*85 + 84
          }
          for (let i = 0; i < nb-1; i++) {
                  dst[ndst++] = (v >> 24) & 255;
                  v <<= 8
          }
  }

  if (ndst < src.length) {
      dst = dst.subarray(0, ndst);
  }

  return dst;
}

